          {
            "name": "DomainName",
            "in": "path",
            "required": true,
            "description": "The unique name of the domain.",
            "schema": {
              "type": "string",
              "pattern": "^[a-zA-Z0-9_-]+$",
              "minLength": 1,
              "maxLength": 64
            }
