                    "properties": {
                      "Address1": {
                        "allOf": [
                          { "$ref": "#/components/schemas/string1To255" },
                          {
                            "description": "The first line of a customer address."
                          }
                        ]
                      },
                      "Address2": {
                        "allOf": [
                          { "$ref": "#/components/schemas/string1To255" },
                          {
                            "description": "The second line of a customer address."
                          }
                        ]
                      },
                      "Address3": {
                        "allOf": [
                          { "$ref": "#/components/schemas/string1To255" },
                          {
                            "description": "The third line of a customer address."
                          }
